import{_ as e,o as i,c as t,O as o}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 59.1-92.3 Registrability.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/59.1-92.3.md","filePath":"vacode/59.1-92.3.md"}'),a={name:"vacode/59.1-92.3.md"},r=o('<h1 id="§-59-1-92-3-registrability" tabindex="-1">§ 59.1-92.3 Registrability. <a class="header-anchor" href="#§-59-1-92-3-registrability" aria-label="Permalink to &quot;§ 59.1-92.3 Registrability.&quot;">​</a></h1><p>A mark by which the goods or services of any applicant for registration may be distinguished from the goods or services of others shall not be registered if it consists of or comprises:</p><ol><li><p>Any immoral, deceptive or scandalous matter;</p></li><li><p>Any matter which may falsely suggest a connection with persons, living or dead, institutions, beliefs, or national symbols, or bring them into contempt or disrepute;</p></li><li><p>The flag or coat of arms or other insignia of the United States, or of any state or municipality, or of any foreign nation, or any simulation thereof;</p></li><li><p>The name, signature or portrait identifying a particular living individual, except by the individual&#39;s written consent;</p></li><li><p>A mark which (i) when used on or in connection with the goods or services of the applicant, is merely descriptive or deceptively misdescriptive of them; (ii) when used on or in connection with the goods or services of the applicant, is primarily geographically descriptive or deceptively misdescriptive of them; or (iii) is primarily merely a surname; however, nothing in this subdivision shall prevent the registration of a mark used by the applicant which has become distinctive in this Commonwealth of the applicant&#39;s goods or services. The Commission may accept as prima facie evidence that the mark has become distinctive, as used on or in connection with the applicant&#39;s goods or services, proof of continuous use thereof as a mark by the applicant in this Commonwealth for the five years before the date of the application for registration; or</p></li><li><p>A mark which so resembles a mark registered in this Commonwealth or a trademark, service mark or trade name previously used in this Commonwealth by another and not abandoned, as to be likely, when used on or in connection with the goods or services of the applicant, to cause confusion or mistake, or to deceive.</p></li></ol><p>1998, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0819" target="_blank" rel="noreferrer">819</a>.</p>',4),s=[r];function n(c,l,h,p,d,m){return i(),t("div",null,s)}const v=e(a,[["render",n]]);export{g as __pageData,v as default};
